  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lake Andes Wetland
  Management District outlines District accomplishments during the 1990 calendar year.
  The report begins with an introduction to the District and information about weather
  conditions and land acquisition activities. The planning section discusses compliance
  with environmental and cultural resource mandates and research and investigations.
  The administration section discusses personnel, youth programs, funding, safety,
  and technical assistance. Habitat management is covered; wetlands, croplands, grasslands,
  grazing, haying, fire management, pest control, and WPA easement monitoring are
  discussed. The wildlife section of the report discusses wildlife diversity, endangered
  and threatened species, waterfowl, marsh and water birds, raptors, other migratory
  birds, game mammals, other resident wildlife, and disease prevention and control.
  Interpretation and recreation activities are outlined; topics include information
  and interpretation, hunting, trapping, and law enforcement. The equipment and facilities
  section discusses new construction, rehabilitation, and major maintenance. Items
  of interest, photographs, and brochures are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
